import { BrowserRouter as Router,Route } from "react-router-dom";
import AdminLogin from "../AdminLogin/AdminLogin";
import AdminManager from "../AdminManager/AdminManager";
import Login from "../Login/Login";
import CompanyRegister from "../CompanyRegister/CompanyRegister";
import CompanyList from "../CompanyList/CompanyList";
import ForgotPassword from "../ForgotPassword/ForgotPassword";
import EditCompany from "../EditCompany/EditCompany";

function RouterURL(){
    const PrivateRouter = ({ component: Component, ... rest}) =>(
        <Route {... rest} render={(props) => 
            getToken() 
            ? <Component {... props}/> 
            : <Redirect to={{pathname: '/', state:{from: props.location} }}/>}/>
    )
    return(
        <Router>
            <Route exact path="/" component={Login}/>
            <Route path="/admin" component={AdminLogin}/>
            <PrivateRouter path="/admin-manager" component={AdminManager}/>
            <PrivateRouter path="/company-register" component={CompanyRegister}/>
            <PrivateRouter path="/company-list" component={CompanyList}/>
            <PrivateRouter path="/forgot-password" component={ForgotPassword}/>
            <PrivateRouter path="/edit-company" component={EditCompany}/>
        </Router>
    );
}
export default RouterURL;
